import React from 'react';
import '../App.css';
import {ContentComponentStyled} from '../styledComponent/ContentComponent-styled';
import {FooterStyled} from '../styledComponent/Footer-styled';
import {TextStyled} from '../styledComponent/TextStyled';
import {Form, Input, Button, Checkbox} from 'antd';
import {LoginStyled} from "../styledComponent/Login-styled";
import {UserStyled} from "../styledComponent/User-styled";


const Login: React.FC = () => (
    <LoginStyled>
        <UserStyled valid={false}>
            <TextStyled textSize={15} color={'black'} fontWeight={"normal"}>
                Username
            </TextStyled>
            <Input/>
        </UserStyled>


    </LoginStyled>

)


export default Login;
